import axios from 'axios';
const API_URL = 'http://localhost:5000/api';
const api = axios.create({
  baseURL: API_URL,
  withCredentials: true
});

// Auth API
export const authAPI = {
  login: (email, password) => api.post('/auth/login', {
    email,
    password
  }).then(res => res.data),
  register: userData => api.post('/auth/register', userData).then(res => res.data),
  logout: () => api.post('/auth/logout').then(res => res.data),
  getCurrentUser: () => api.get('/auth/me').then(res => res.data)
};

// User API
export const userAPI = {
  getCurrentUser: () => api.get('/user/current').then(res => res.data),
  getUserById: userId => api.get(`/user/${userId}`).then(res => res.data),
  updateUser: userData => api.put('/user/current', userData).then(res => res.data)
};

// Pets API
export const petsAPI = {
  getSpecies: () => api.get('/pets/species').then(res => res.data),
  getBreeds: (filters = {}) => api.get('/pets/breeds', {
    params: filters
  }).then(res => res.data),
  getBreedById: id => api.get(`/pets/breeds/${id}`).then(res => res.data),
  addPet: petData => api.post('/pets/my-pets', petData).then(res => res.data),
  getMyPets: () => api.get('/pets/my-pets').then(res => res.data),
  getPetById: id => api.get(`/pets/my-pets/${id}`).then(res => res.data),
  updatePet: (id, petData) => api.put(`/pets/my-pets/${id}`, petData).then(res => res.data),
  deletePet: id => api.delete(`/pets/my-pets/${id}`).then(res => res.data),
  getReminders: () => api.get('/pets/reminders').then(res => res.data),
  createReminder: reminderData => api.post('/pets/reminders', reminderData).then(res => res.data),
  updateReminderStatus: (id, status) => api.patch(`/pets/reminders/${id}`, {
    status
  }).then(res => res.data),
  getReminderTypes: () => api.get('/pets/reminder-types').then(res => res.data)
};

